import { MessageBox } from 'react-chat-elements';
import { ChatItem, MessageList } from 'react-chat-elements'
import React from 'react';

function Chat() {
    return(
        <MessageList
        className='message-list'
        lockable={true}
        toBottomHeight={'100%'}
        dataSource={[
            {
                position: 'right',
                type: 'text',
                text: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit',
                date: new Date(),
            },

        ]} />
    )
}

export default Chat;
